import React from 'react';
import Nav from './components/Nav';
import { Route } from 'react-router-dom';
import About from './components/About';
import Home from './components/Home';
import './App.css';

const App = () => {
  return (
    <div>
      <Nav />
      <Route path="/">
        <Home />
      </Route>
      <Route path="/about">
        <About />
      </Route>
      <Route path="/projects">
        {/* <Projects /> */}
      </Route>
      <Route path="/resume">
        {/* <Resume /> */}
      </Route>
    </div>
  );
}

export default App;
